import React, {Component} from "react";
import {MDBBtn, MDBCard, MDBCardBody, MDBCardHeader, MDBCol, MDBContainer, MDBIcon, MDBInput, MDBRow} from "mdbreact";

class AddExpanses extends Component{
    state = {}

    render() {
        // const { onAdd } = this.props;
        // let { name, status } = this.state;
        return (
            <div>
                <MDBContainer>
                    <MDBRow className="d-flex justify-content-center">
                        <MDBCol md="6">
                            <MDBCard>
                                <MDBCardBody>
                                    <MDBCardHeader className="form-header blue-gradient rounded">
                                        <h3 className="my-3">
                                            <MDBIcon icon="plus-circle" /> Insert Category
                                        </h3>
                                    </MDBCardHeader>
                                    <form>
                                        <div className="grey-text">
                                            <MDBInput
                                                label="Category Name"
                                                group
                                                type="text"
                                                validate
                                                // onChange={this.onNameChange}
                                            />
                                            <MDBInput
                                                label="Category status"
                                                group
                                                type="text"
                                                validate
                                                // onChange={this.onStatusChange}
                                            />
                                        </div>

                                        <div className="text-center mt-4">
                                            <MDBBtn
                                                color="light-blue"
                                                className="mb-3"
                                                // onClick={() => onAdd(name, status)}
                                            >
                                                Add
                                            </MDBBtn>
                                        </div>
                                    </form>
                                </MDBCardBody>
                            </MDBCard>
                        </MDBCol>
                    </MDBRow>
                </MDBContainer>
            </div>
        );
    }
}

export default AddExpanses;
